var genreNames = Object.keys(mySpotify);

export default function App() {
  const [songList, setSongList] = useState(mySpotify.bollywoodRetro);

  function genreCickHandler(genre) {
    var songs = mySpotify[genre];
    setSongList(songs);
  }

  function getSongsHere(songs) {
    var name = songs.name;
    var imageURL = songs.image;
    var artists = songs.artists;
    var released = songs.released;
    var rating = songs.rating;
    var description = songs.description;
    var songList = (
      <li>
        <img alt="album thumbnail" src={imageURL} />
        <div style={{ padding: "0rem 1rem" }}>
          <h3 style={{ fontSize: "1.5rem" }}>{name}</h3>
          <p style={{ fontSize: "0.9rem" }}>Artists - {artists}</p>
          <p>Released - {released}</p>
          <p>Rating - {rating}</p>
          <p>Description - {description}</p>
        </div>
      </li>
    );

    return songList;
  }

  return (
    <div className="App">
      <h1>🎼MySpotify🎶</h1>
      <div>
        {genreNames.map((genre) => {
          return (
            <button
              className="btn"
              onClick={() => genreCickHandler(genre)}
              style={{ padding: "0.5rem", margin: "1rem", cursor: "pointer" }}
            >
              {genre}
            </button>
          );
        })}
      </div>
      <ul>
        {songList.map((songs) => {
          return getSongsHere(songs);
        })}
      </ul>
    </div>
  );
}
